  if (this.errorCodes != null) {
    return;
  }
  ContainerRetryContextProtoOrBuilder p = viaProto ? proto : builder;
  this.errorCodes = new HashSet<>();
  this.errorCodes.addAll(p.getErrorCodesList());
}
